function Main() {
    return (
      <div className="main">
          <div className="main__title-block">
              <div className='main__title-container'>
                  <div className='main__title'>
                      <h1 className='main__title-name'></h1>
                      <span className='main__title-sub'></span>  
                  </div>

                  <p className='main__subtitle'></p>
              </div>
          </div>
      </div>
    );
  }

  export default Main;
